import React from "react";
import "./style.css";
function Carrosel() {
	return (
		<div id="carouselOficina" class="carousel slide text-center" data-bs-ride="carousel">
			<div class="carousel-inner">
				<div class="carousel-item active">
					<img src="https://i.imgur.com/Q7quyWo.jpg" class="rounded w-50" alt="..." />
				</div>
				<div class="carousel-item">
					<img src="https://i.imgur.com/jrmmogJ.jpg" class="rounded w-50" alt="..." />
				</div>
				<div class="carousel-item">
					<img src="https://i.imgur.com/z7teosV.jpg" class="rounded w-50" alt="..." />
				</div>
				<div class="carousel-item">
					<img src="https://i.imgur.com/BEoCyX5.jpg" class="rounded w-50" alt="..." />
				</div>
			</div>
			
		</div>
	);
}
export default Carrosel;
